import React from 'react'
import '../style/form.css'
import { makeStyles, Grid, Card, CardMedia, CardContent, Typography } from '@material-ui/core';



const useStyles = makeStyles({
    gridContainer: {
      paddingLeft: "20px",
      paddingRight: "20px",
      background:"#7555D9",
      minHeight:"100vh"
    },
    formcategory:{
      marginBottom:"100px"  
    }
  });

function Form() {
    const classes = useStyles();
  return (
    <Grid
    container
    className={classes.gridContainer}
    justify="center"
  >
    <Grid item xs={12} sm={6} md={3} className={classes.head}>
    <h3 className="text1">Choose your</h3>
    <h3 className="text2">Category</h3>
    </Grid>
    <Grid
    container
    justify="center"
  >
    <Grid item xs={12} sm={6} md={6}lg={4} className={classes.formcategory} >
    <Card className="form-card">
    <form >
    <h3 className="language">Select Language:</h3>
    <select  defaultValue="Select Gender">
    <option defaultValue>Select Gender</option>
    <option value="male">Male</option>
    <option value="female">Female</option>
</select>
<h3 className="language">Select Language:</h3>
 <input type="text"  className="name" placeholder="FirstName..." /><br />
  <button className="started">Start</button>
</form>

    </Card>
    </Grid>
    </Grid>


  </Grid>
  );
}

export default Form
